import React, { useState, useEffect } from 'react';
import { BrowserRouter, Link, Route, Switch, useHistory, useLocation  } from 'react-router-dom';
import { AppBar, Typography, Toolbar, Avatar, Button } from '@material-ui/core';

import { useDispatch } from 'react-redux';
import decode from 'jwt-decode';

import Home from '../pages/home';
import Uploading from '../uploading/client/src/App';
import useStyles from './styles';

const NavBar = () =>{
  const classes = useStyles();
  const user = null;



  return (
    <BrowserRouter>
      <nav className="navbar">
        <div class="logo">SoundScape Mapper</div>
        <ul class="nav-links">
          <input type="checkbox" id="checkbox_toggle" />
          <label for="checkbox_toggle" class="hamburger">&#9776;</label>
          <div class="menu">
            <li><Link to="/">Home</Link></li>
            <li><Link to="/upload">Upload</Link></li>
            <li><Link to="/home">Contact Us</Link></li>
            <div >
        {user?.result ? (
          <div className={classes.profile}>
            <Avatar className={classes.purple} alt={user?.result.name} src={user?.result.imageUrl}>{user?.result.name.charAt(0)}</Avatar>
            <Typography className={classes.userName} variant="h6">{user?.result.name}</Typography>
            <Button variant="contained" className={'LOGEOUT'} color="secondary" >Logout</Button>
          </div>
        ) : (
          <Button component={Link} to="/auth" variant="contained" color="primary">Sign In</Button>
        )}
      </div>
          </div>
          
        </ul>
        
        
          
      </nav>

      <Switch>
        <Route path="/home">
          <Home />
        </Route>
        <Route path="/upload">
          <Uploading />
        </Route>
      </Switch>
    </BrowserRouter>   
  );
};

export default NavBar;
